Date.prototype.format=function(a){var b=this;var c=function(g,f){if(!f){f=2}g=new String(g);for(var e=0,d="";e<(f-g.length);e++){d+="0"}return d+g};return a.replace(/"[^"]*"|'[^']*'|\b(?:d{1,4}|M{1,4}|yy(?:yy)?|([hHmstT])\1?|[lLZ])\b/g,function(d){switch(d){case"d":return b.getDate();case"dd":return c(b.getDate());case"ddd":return['<span style="color:#b94a48">Sun</span>',"Mon","Tue","Wed","Thr","Fri",'<span style="color:#666">Sat</span>'][b.getDay()];case"dddd":return["Sunday","Monday","Tuesday","Wednesday","Thursday","Friday","Saturday"][b.getDay()];case"M":return b.getMonth()+1;case"MM":return c(b.getMonth()+1);case"MMM":return["Jan","Feb","Mar","Apr","May","Jun","Jul","Aug","Sep","Oct","Nov","Dec"][b.getMonth()];case"MMMM":return["January","February","March","April","May","June","July","August","September","October","November","December"][b.getMonth()];case"yy":return new String(b.getFullYear()).substr(2);case"yyyy":return b.getFullYear();case"h":return b.getHours()%12||12;case"hh":return c(b.getHours()%12||12);case"H":return b.getHours();case"HH":return c(b.getHours());case"m":return b.getMinutes();case"mm":return c(b.getMinutes());case"s":return b.getSeconds();case"ss":return c(b.getSeconds());case"l":return b.getMilliseconds();case"ll":return c(b.getMilliseconds());case"tt":return b.getHours()<12?"am":"pm";case"TT":return b.getHours()<12?"AM":"PM"}})};